$(document).ready(function(){$.display={pageSpeed:300,loadingTime:1500,page:{},switchPage:function(e){$(".page").not(e).css("Index",0),$(e).css("Index",10),$(e).show();var a=e.split("page")[1].toLowerCase();console.log(a),$.display.page[a].load(),$(".page").not(e).css({left:"-200vw"}).hide(),$(e).css({left:"0"}).show()},toggleLoadingScreen:function(){$("#loadingOverlay").show(),setTimeout(function(){$("#loadingOverlay").fadeOut("slow",function(){$(this).hide()})},$.display.loadingTime)},toastSuccess:function(e){Materialize.toast('<i class="mdi-action-thumb-up small left"></i> '+e,4e3,"success")},toastInfo:function(e){Materialize.toast('<i class="mdi-action-info small left"></i> '+e,4e3,"info")},toastError:function(e){Materialize.toast('<i class="mdi-alert-warning small left"></i> '+e,4e3,"error")}}});